    set isPlay(newValue) {
        this.__isPlay.set(newValue);
    }
    get playingIndex() {
        return this.__playingIndex.get();
    }
    set playingIndex(newValue) {
        this.__playingIndex.set(newValue);
    }
    get miniPlayerHeight() {
        return this.__miniPlayerHeight.get();
