                let message = err && err[0] ? err[0].message : '';
                let code = err && err[0] ? err[0].responseCode : '';
                reject(new AxiosError(message, code, config, null, null));
            })

        }).catch(error => {
            reject(new AxiosError(error, AxiosError.ERR_NETWORK, config, null, null));
        })
